CREATE TABLE lk_bemerkungzumverfahren (
    verfbem character(2) DEFAULT ''::bpchar NOT NULL,
    bezeichnung text
);


ALTER TABLE ONLY lk_bemerkungzumverfahren  ADD CONSTRAINT lk_bemerkgzumverfahren_pkey PRIMARY KEY (verfbem);

		

CREATE TABLE lk_aemtergemeinden (
    id integer NOT NULL,
    kreis_name character varying(255),
    kreis_schluessel character(5),
    amt_schluessel character(4),
    amt_name character varying(255),
    gemeinde_schluessel character(8),
    gemeinde_name character varying(255)
);

COMMENT ON TABLE lk_aemtergemeinden IS 'Tabelle dient vorrangig der Erzeugung von Ämtergeometrien aus den Gemeindegeometrien. Die Daten sind abgeleitet aus der Veroeffentlichung des Statistischen Landesamtes - Schlüsselbrücke_Amtsschlüssel_a533-2011-01
http://www.statistik-mv.de/cms2/STAM_prod/STAM/de/bhf/Veroeffentlichungen/index.jsp';


CREATE SEQUENCE lk_aemtergemeinden_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


ALTER SEQUENCE lk_aemtergemeinden_id_seq OWNED BY lk_aemtergemeinden.id;

ALTER TABLE ONLY lk_aemtergemeinden ALTER COLUMN id SET DEFAULT nextval('lk_aemtergemeinden_id_seq'::regclass);



SELECT pg_catalog.setval('lk_aemtergemeinden_id_seq', 892, true);


